void findCommonElements(int arr1[], int arr2[], int m, int n) {
    int i, j;

    // Iterate through both arrays
    for (i = 0; i < m; i++) {
        for (j = 0; j < n; j++) {
            // Check if current elements are equal
            if (arr1[i] == arr2[j]) {
